import React from "react";

function Footer({ textFooter }) {
  return (
    <div>
      <div className="wrapper flex-grow-1">
        <footer className="card-footer flex-fill bg-info text-white">
          {textFooter}
        </footer>
      </div>
    </div>
  );
}
export default Footer;
